import styled from "styled-components";

const MainStyledRegister = styled.main`
  width: 100vw;
  height: 92vh;
  background-color: var(--grey-4);
  form {
    display: flex;
    flex-direction: column;
    width: 30rem;
    margin: 0 auto;
    gap: 1rem;
  }
  p {
    color: var(--grey-0);
  }
`;

export default MainStyledRegister;
